CREATE TABLE ui_app
(
  ui_app_id integer NOT NULL,
  name character varying(50),
  display_name character varying(50)
);

CREATE TABLE ui_form
(
  id integer,
  form_table_name character varying(100),
  order_by integer,
  display_name character varying(100),
  name_column_display_name character varying(50),
  group_by character varying(30),
  ui_app_id integer
);

CREATE TABLE ui_form_link
(
  ui_form_id integer,
  ui_form_link_id integer,
  link_name character varying(50),
  single_select boolean
);

CREATE TABLE users
(
  id serial PRIMARY KEY,
  name character varying(100)
);

CREATE TABLE role
(
  id serial PRIMARY KEY,
  name character varying(100)
);

CREATE TABLE users_role_relationship
(
  users_id Integer Not null,
  role_id Integer Not null
);

CREATE TABLE foodcategory
(
  id serial PRIMARY KEY,
  name character varying(100)  
);

CREATE TABLE pricecategory
(
  id serial PRIMARY KEY,
  name character varying(100)  
);

create table food_relationship(
	foodtruck_id Integer,
	foodcategory_id Integer,
	pricecategory_id Integer
);

CREATE TABLE event
(
  id serial NOT NULL,
  name character varying(100),
  date character varying(100),
  "time" character varying(100),
  address character varying(100),
  type character varying(100)
);

